import { faAdobe } from '@fortawesome/free-brands-svg-icons/faAdobe'
export default function SearchBox() {
    return(
        <div className='h-8 w-1/4 border border-black m-5 text-right'>
            <FontAwesomeIcon icon={faAdobe}/>
        </div>
    )
}
